export const Api = async (URL) => {
    try {
        const resp = await fetch(URL);
        const data = await resp.json();
        return data;
    } catch (error) {
        console.log(error);
    }
}

export const CreateUser = async (requestPayload) => {
    try {
        const resp = await fetch('https://api.escuelajs.co/api/v1/users/', {
            method:'POST',
            headers:{
                "Content-Type":"application/json"
            },
            body:JSON.stringify({
                requestPayload
            })
        });
        const data = await resp.json();
        return data;
    } catch (error) {
        console.log(error);
    }
}
